import React, { useEffect, useState } from "react";

import { API } from "../../../AxiosConfig";

import "./Customer.css";

const Customer = () => {
	const [customer, setCustomer] = useState([]);

	useEffect(() => {
		API.get("").then(({ data }) => setCustomer(data));
	});

	return (
		<div>
			{customer.map((c) => {
				return (
					<div id={c.id} className="customer-holder">
						ID: {c.id}
						<br />
						Name: {c.name}
						<br />
						Phone number: {c.phoneNumber}
						<br />
						Gender : {c.gender}
					</div>
				);
			})}
		</div>
	);
};

export default Customer;
